function copy(that){
    var inp =document.createElement('input');
    document.body.appendChild(inp)
    inp.value =that.textContent
    inp.select();
    document.execCommand('copy',false);
    inp.remove();
    document.getElementById('john1').innerHTML="Copied To Clipboard! ";
    setTimeout(function(){ document.getElementById('john1').innerHTML="ianchiang818@gmail.com"; }, 1500);
}

/* CSS variables */

:root {

    --main-color: #1b5ab3;

}

.container {
    display: grid;
    grid-template-columns: 1fr 30px 200px 200px 30px 1fr;
    width: 100%;
    padding: calc(var(--section-padding) * 2) 0;
}
    .container > .row-short {
        display: inline-block;
        grid-column: 3 / 5;
    }
    .container > .row {
        display: inline-block;
        grid-column: 2 / 6;
    }
        .container > .row > .column {
            display: inline-block;
            float: left;
        }
            .container > .row > .column.left {
                width: 50%;
            }
            .container > .row > .column.right {
                width: 40%;
                margin-left: 10%;
            }

/* custom CSS - everything else, that wasn't styled with components css */

/* layout */
.container.hero {
    padding-bottom: var(--section-padding);
    background-image: url(../img/calgary.jpg);
    background-size: cover;
    background-position: bottom center;
    background-attachment: fixed;
    min-height: 100vh;
}

footer.container {
    padding-top: 0;
    padding-bottom: calc(var(--section-padding) * 1.5);
}
    footer.container > .row-short {
        margin-top: var(--section-padding);
    }

.bg-main-color {
    background-color: var(--main-color);
}

/* hero */
.hero {
    text-align: center;
}

.hero img {
    height: 40px;
    margin-bottom: calc(var(--hero-space) * 2);
}
.hero h1 {
    display: inline-block;
    width: 100%;
    margin-bottom: var(--hero-space);
    text-transform: uppercase;
    font-size: 50px;
    color: #000;
}
.hero p {
    display: inline-block;
    width: 100%;
    margin-bottom: calc(var(--hero-space) * 3);
    font-size: 18px;
    color: var(--grey-color);
}
.hero .clock {
    margin-bottom: calc(var(--hero-space) * 2);
}
.hero .form {
    width: 90%;
    margin: 0 5% var(--hero-space);
}
    .hero .form > input:not(.btn) {
        width: 100%;
        color: #fff;
        background-color: transparent;
        border-bottom-color: #fff;
    }
        .hero .form > input:not(.btn)::placeholder {
            color: #fff;
        }
    .hero .form > .btn {
        float: none;
    }

/* main content */
main h2 {
    display: inline-block;
    width: 100%;
    margin-bottom: var(--main-space);
    color: #000;
    font-size: 21px;
    text-transform: uppercase;
}
main p {
    display: inline-block;
    width: 100%;
    margin-bottom: var(--main-space);
    font-size: 18px;
    line-height: 26px;
    color: var(--grey-color);
}
    main p > a {
        color: var(--secondary-color);
        text-decoration-line: none;
    }

main .form > .btn {
    float: right;
}

/* footer */
footer {
    text-align: center;
    line-height: 32px;
    font-size: 17px;
    color: #fffa;
}
    footer.container > .row {
        display: flex;
        justify-content: center;
        flex-wrap: wrap;
        gap: 10px;
        padding: 10px 20px;
        border-bottom: 1px solid #fff;
        position: relative;
    }
    footer .social.fa {
        display: inline-block;
        width: 40px;
        padding: 10px;
        line-height: 20px;
        color: #fff;
        text-align: center;
        border-radius: 50%;
        transition: all 0.5s;
    }
        footer .social.fa:hover {
            background-color: #fff;
            color: var(--main-color);
        }
    footer .btn.circle {
        position: absolute;
        top: -24px;
        right: -13px;
    }
    footer .text-trio {
        display: inline-block;
        width: 100%;
    }
        footer .text-trio > .text {
            display: inline-block;
            padding: 0 10px;
            position: relative;
        }
            footer .text-trio > .text::before {
                display: inline-block;
                content: '';
                width: 1px;
                height: 14px;
                background-color: #fff;
                position: absolute;
                top: 50%;
                left: -2px;
                transform: translateY(-50%);
            }
            footer .text-trio > .text:first-of-type::before {
                display: none;
            }
    footer p {
        display: inline-block;
        width: 100%;
    }
    footer a {
        color: #fff;
        text-decoration: none;
    }

@media (max-width: 700px) {
    footer .text-trio > .text {
        width: 100%;
        padding: 0;
    }
        footer .text-trio > .text::before {
            display: none;
        }
}

// butter.js

(function(root){
    var Butter = function() {

        var self = this;

        this.defaults = {
            wrapperId: 'butter',
            wrapperDamper: 0.07,
            cancelOnTouch: false
        }

        this.validateOptions = function(ops) {
            for (var prop in ops) {
                if (self.defaults.hasOwnProperty(prop)) {
                    Object.defineProperty(self.defaults, prop, {value: Object.getOwnPropertyDescriptor(ops, prop).value})
                }
            }
        }

        this.wrapperDamper;
        this.wrapperId;
        this.cancelOnTouch;
        this.wrapper;
        this.wrapperOffset = 0;
        this.animateId;
        this.resizing = false;
        this.active = false;
        this.wrapperHeight;
        this.bodyHeight;
    };

    Butter.prototype = {

        init: function(options) {
            if (options) {
                this.validateOptions(options);
            }

            this.active = true;
            this.resizing = false;
            this.wrapperDamper = this.defaults.wrapperDamper;
            this.wrapperId = this.defaults.wrapperId;
            this.cancelOnTouch = this.defaults.cancelOnTouch;

            this.wrapper = document.getElementById(this.wrapperId);
            this.wrapper.style.position = 'fixed';
            this.wrapper.style.width = '100%';

            this.wrapperHeight = this.wrapper.clientHeight;
            document.body.style.height = this.wrapperHeight + 'px';

            window.addEventListener('resize', this.resize.bind(this));
            if (this.cancelOnTouch) {
                window.addEventListener('touchstart', this.cancel.bind(this));
            }
            this.wrapperOffset = 0.0;
            this.animateId = window.requestAnimationFrame(this.animate.bind(this));

            // window.addEventListener('load', this.resize.bind(this));
        },

        wrapperUpdate: function() {
            var scrollY = (document.scrollingElement != undefined) ? document.scrollingElement.scrollTop : (document.documentElement.scrollTop || 0.0);
            this.wrapperOffset += (scrollY - this.wrapperOffset) * this.wrapperDamper;
            this.wrapper.style.transform = 'translate3d(0,' + (-this.wrapperOffset.toFixed(2)) + 'px, 0)';
        },

        checkResize: function() {
            if (this.wrapperHeight != this.wrapper.clientHeight) {
                this.resize();
            }
        },

        resize: function() {
            var self = this;
            if (!self.resizing) {
                self.resizing = true;
                window.cancelAnimationFrame(self.animateId);
                window.setTimeout(function() {
                    self.wrapperHeight = self.wrapper.clientHeight;
                    if (parseInt(document.body.style.height) != parseInt(self.wrapperHeight)) {
                        document.body.style.height = self.wrapperHeight + 'px';
                    }
                    self.animateId = window.requestAnimationFrame(self.animate.bind(self));
                    self.resizing = false;
                }, 150)
            }
        },

        animate: function() {
            this.checkResize();
            this.wrapperUpdate();
            this.animateId = window.requestAnimationFrame(this.animate.bind(this));
        },

        cancel: function() {
            if (this.active) {
                window.cancelAnimationFrame(this.animateId);

                window.removeEventListener('resize', this.resize);
                window.removeEventListener('touchstart', this.cancel);
                this.wrapper.removeAttribute('style');
                document.body.removeAttribute('style');

                this.active = false;
                this.wrapper = "";
                this.wrapperOffset = 0;
                this.resizing = true;
                this.animateId = "";
            }
        },
    };

    root.butter = new Butter();

})(this);
